import React from "react";
import styles from "./Welcome.module.css"
import NavBar from "../navBar/NavBar";

const Welcome = () => {
    return(
        <div className={styles.container}>
            <NavBar />
            <div className={styles.container__display}>
                <h1 className={styles.display__name}>Roel A. Montoya</h1>
                <div className={styles.display__quote}>What the mind can conceive, it can achieve.</div>
                <div className="display__logos">text</div>
                <a className="display__resume">My Resume</a>
            </div>
        </div>
    );
};

export default Welcome;
